script: |
  super -f text -I q7624.spq | sort > q7624.out

inputs:
  - name: q7624.spq
    data: |
      SELECT + col2 AS col0 FROM tab1 (FORMAT parquet) cor0 WHERE + ( - 78 ) * - col0 - + 35 NOT BETWEEN ( + 64 ) AND - 85 + col1;
  - name: tab1

outputs:
  - name: q7624.out
    data: |
      59
      68
      96
